import React, { useState } from "react";
import "./Header.scss";
import { useNavigate } from "react-router-dom";
import { Link, NavLink } from "react-router-dom";
import burger from "../../../../shared/assets/icons/burger-menu.png";
import { use } from "framer-motion";

const Header = () => {
  // states
  const navigate = useNavigate();

  return (
    <div className="header">
      <div className="header_logo">
        <h3 className="logo_title">Logo</h3>
      </div>
      <div className="header_menu">
        <div class="btn not-active">
          <span></span>
          <span></span>
          <span></span>
        </div>
        <ul className="menu_list">
          <NavLink to="/" className="menu_item">
            Home
          </NavLink>
          <NavLink to="/skills/" className="menu_item">
            Experience
          </NavLink>
          <NavLink to="/project/" className="menu_item">
            Projects
          </NavLink>
        </ul>
      </div>
    </div>
  );
};

export default Header;
